import "./case.module.scss";

import React, { Component } from "react";

export default class Case extends Component {
  render() {
    return (
      <a className='case'>
        <img
          src={require(`${window.location.origin + this.props.img}`)}
          alt=''
        />
        <span>{this.props.title}</span>
      </a>
    );
  }
}
